import { useEffect } from 'react';
import styled from 'styled-components';
import Card from '../../../../card/Card';
import database from '../../../../database';

// Styled Components //
const WelcomeDiv = styled.div`
    min-height: 300px;
    text-align: center;
`;
const Title = styled.h1`
    font-size: 27px;
    text-align: center;
`

// Functions //
const Welcome = () => {
    let [count, setCount] = useState(0);

  useInterval(() => {
    console.log()
    setCount(count + 1);
  }, 1000);

    return(
        <div>
            <Title>Closing Deals</Title>
            <WelcomeDiv>
                <Card item={database.products[0]}  />
            </WelcomeDiv>
        </div>
    )
}

export default Welcome;
